import { ObjectsCache } from "./objects";
import { TagsCache } from "./tags";
import { UsersCache } from "./users";


/**
 * Stores custom values for data generated by backend
 */
export class BackendCache {
    constructor() {
        this.objects = new ObjectsCache();
        this.tags = new TagsCache();
        this.users = new UsersCache();
    }
}
